// App.js
import React, { useEffect, useState } from 'react';
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import { createClient } from '@supabase/supabase-js';
import PrivateRoute from './utils/PrivateRoute';
import AddExercise from './components/AddExercise/AddExercise';
import AddSubSession from './components/AddSubSession/AddSubSession';
import AddUserWeight from './components/AddUserWeight/AddUserWeight';

const supabase = createClient(
  process.env.REACT_APP_SUPABASE_URL,
  process.env.REACT_APP_ANON_KEY
);

function App() {
  const [session, setSession] = useState(null);

  useEffect(() => {
    supabase.auth.onAuthStateChange((_event, session) => {
      setSession(session);
    });
  }, []);

  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<Dashboard supabase={supabase} session={session} />} />
        <Route element={<PrivateRoute supabase={supabase} session={session} />}>
          <Route path="/add-exercise" element={<AddExercise supabase={supabase} session={session} />} />
        </Route>
        <Route element={<PrivateRoute supabase={supabase} session={session} />}>
          <Route path="/add-sub-session" exact element={<AddSubSession />} />
        </Route>
        <Route element={<PrivateRoute supabase={supabase} session={session} />}>
          <Route path="/add-user-weight" element={<AddUserWeight />} />
        </Route>
      </Routes>
    </BrowserRouter>
  );
}

export default App;
